SSN 416-01-xxxx from Alabama given out from 1936 to 1950. Estimated age of a person with this number is 81-99 years old.<br>

<div id="list">
    <!-- list displays here -->
</div>
<script>
    var text = "";
    var i;
    for (i = 1; i <= 9999; i++) {
        text += "416-01-";
        if (i<1000){text +=0;}
        if (i<100){text +=0;}
        if (i<10){text +=0;}
        text += i + "<br>";
        
       }
document.getElementById('list').innerHTML = text;
